import React, { useState } from "react";

function submitHandler() {}
function Button() {
  const [name, setName] = useState("");
  return (
    <>
      <button onSubmit={submitHandler}>+</button>
      <input
        type="text"
        value={name}
        onChange={(e) => setName(e.target.value)}
      />
    </>
  );
}

export default Button;
